import React from 'react';
import ReactDOM from 'react-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


class Gextension extends React.Component{
    constructor(props){
        super(props);

    }

    render(){
        return(
            <div>
                <h1>
                    {this.props.name}
                </h1>
            </div>
        )
    }
}
export default Gextension;
